AoC_input = ''''''

n = 14 #lengte

#init
sop_marker = AoC_input[0:n] #int marker als eerste n letters

for letter1 in AoC_input[n:]:
    count_distinct = 0
    
    #als alle n letters uniek zijn, dan zou deze som precies n moeten zijn. 
    for letter2 in sop_marker:
        count_distinct += sop_marker.count(letter2) #telt hoe vaak letter2 in de marker zit. 
    
    if count_distinct == n: #als waar dan zijn alle n letters uniek. 
        #vind waar deze n letters in de string staan en tel er vier bij op (je wilt index van laatste letter)
        character = AoC_input.find(sop_marker) + n 
        break
    else:
        #de nieuwe marker (gooi eerste letter weg en voeg letter1 toe.
        sop_marker = sop_marker[1:] + letter1

print(character)